import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
// import NavDropdown from 'react-bootstrap/NavDropdown';
import {Button} from "react-bootstrap";
import React from "react";

export default class NavBarHome extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
        }
        this.bind();
    };
    bind() {
        this.redirectFromWhats = this.redirectFromWhats.bind(this);
    }

    redirectFromWhats(){
        return window.open("https://api.whatsapp.com/send/?phone=5511948816521&text&type=phone_number&app_absent=0")
    }

    render (){
        return (
            <>
                <Navbar expand="lg" bg="dark" variant={"dark"}>
                    <Container>
                        <Navbar.Brand>Dr. Leonardo Simões <br/>
                            Nutrição Clínica e Esportiva</Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="me-auto">
                                <Nav.Link href="#home">Sobre Leonardo</Nav.Link>
                                <Nav.Link href="#home">Planos</Nav.Link>
                                <Nav.Link href="#link">Contato</Nav.Link>
                                <Button className="btn-success position-absolute end-0" onClick={() => this.redirectFromWhats()}>
                                    <i className="bi bi-whatsapp"></i>
                                    Agendar consulta
                                </Button>
                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
            </>
    );
}
}
